import BookForm from "./components/BookForm/BookForm";
import Books from "./components/Books/Books";
import { BookContextProvider } from "./context/BookContext";

function App() {
  return (
    <BookContextProvider>
      <div className="container py-10">
        <Books />
        <BookForm />
      </div>
    </BookContextProvider>
  );
}

export default App;
